// App.jsx (plain CSS version)
// Place this code in: src/App.jsx
// Create a companion CSS file at: src/App.css (content provided below in the same document)

import React, { useState, useEffect, useRef } from 'react';
import { BrowserRouter as Router, Routes, Route, useNavigate, useParams } from 'react-router-dom';
import './App.css';

// ---------------------------------------------
// InsightFlow — Gradient + Vibrant design (Plain CSS)
// Single-file React app component. Default export: App
// Drop into src/App.jsx and create src/App.css with the styles shown at the bottom of this file.
// ---------------------------------------------

function Header() {
  return (
    <header className="if-header">
      <div className="if-container if-header-inner">
        <div className="if-brand">
          <div className="if-logo-mark" aria-hidden>
            {/* simple logo mark (SVG) */}
            <svg width="20" height="20" viewBox="0 0 24 24" fill="none" xmlns="http://www.w3.org/2000/svg">
              <rect x="3" y="3" width="18" height="18" rx="4" stroke="white" strokeWidth="1.5" />
              <path d="M7 14L10.5 9.5L13 12.5L17 7" stroke="white" strokeWidth="1.5" strokeLinecap="round" strokeLinejoin="round" />
            </svg>
          </div>

          <div className="if-brand-text">
            <div className="if-title">InsightFlow</div>
            <div className="if-sub">Data • Visualize • Automate</div>
          </div>
        </div>

        <nav className="if-nav">
          <a className="if-nav-link" href="#">Docs</a>
          <a className="if-nav-link" href="#">Contact</a>
          <button className="if-btn if-btn-ghost">Sign in</button>
        </nav>
      </div>
    </header>
  );
}

function Home() {
  const ANALYSES = [
    { id: 'energy-analysis', label: 'Energy Data Analysis' },
    { id: 'stock-analysis', label: 'Stock Data Analysis' },
    { id: 'attendance-analysis', label: 'School Attendance Analysis' },
    { id: 'custom', label: 'Custom CSV Insights' },
  ];

  const navigate = useNavigate();
  const [selection, setSelection] = useState('');

  const onChange = (e) => {
    const val = e.target.value;
    setSelection(val);
    if (val) navigate(`/${val}`);
  };

  return (
    <main className="if-container if-main">
      <section className="if-grid">
        <div className="if-card if-card-large">
          <h2 className="if-h2">Welcome to InsightFlow</h2>
          <p className="if-lead">
            InsightFlow provides a vibrant, fast and delightful experience for turning raw
            datasets into actionable insights. Upload CSV or Excel files, pick an analysis
            type and get visual reports with recommendations — instantly.
          </p>

          <div className="if-form">
            <label className="if-label">Choose analysis</label>
            <select value={selection} onChange={onChange} className="if-select">
              <option value="">— Select an analysis —</option>
              {ANALYSES.map((a) => (
                <option key={a.id} value={a.id}>{a.label}</option>
              ))}
            </select>

            <div className="if-tip"><strong>Tip:</strong> Try the <em>Energy Data Analysis</em> for a quick demo dataset.</div>
          </div>
        </div>

        <div className="if-card if-card-accent">
          <div className="if-card-header">
            <div>
              <h3 className="if-h3">Quick Overview</h3>
              <p className="if-muted">Vibrant charts, fast processing, and clear outputs.</p>
            </div>
            <div className="if-badge">v1.0</div>
          </div>

          <div className="if-chart-hero">
            <div className="if-chart-placeholder">
              <div className="if-chart-title">Beautiful Charts</div>
              <div className="if-chart-sub">Interactive, responsive, and exportable</div>
            </div>
          </div>

          <div className="if-stats">
            <StatCard title="Uploads" value="1.2k" />
            <StatCard title="Analyses" value="84" />
            <StatCard title="Avg. time" value="8s" />
          </div>
        </div>
      </section>

      <section className="if-feature-row">
        <FeatureCard title="Fast Processing" desc="Upload CSV/XLSX and get results in seconds." />
        <FeatureCard title="Shareable Reports" desc="Export PDF or share a report link with stakeholders." />
        <FeatureCard title="AI Recommendations" desc="Auto-generated suggestions for improvements and anomalies." />
      </section>
    </main>
  );
}

function StatCard({ title, value }) {
  return (
    <div className="if-stat">
      <div className="if-stat-title">{title}</div>
      <div className="if-stat-value">{value}</div>
    </div>
  );
}

function FeatureCard({ title, desc }) {
  return (
    <div className="if-feature">
      <h4 className="if-feature-title">{title}</h4>
      <p className="if-feature-desc">{desc}</p>
    </div>
  );
}

function AnalysisPage() {
  const { analysisType } = useParams();
  const [file, setFile] = useState(null);
  const [columns, setColumns] = useState([]);
  const [loading, setLoading] = useState(false);
  const fileRef = useRef();

  useEffect(() => {
    // placeholder for fetching analysis-specific meta
  }, [analysisType]);

  const onUpload = async (e) => {
    e.preventDefault();
    if (!file) return;
    setLoading(true);
    try {
      await new Promise((r) => setTimeout(r, 900));
      setColumns(['Date', 'Value', 'Category', 'Region']);
    } catch (err) {
      console.error(err);
    } finally {
      setLoading(false);
    }
  };

  return (
    <main className="if-container if-main">
      <div className="if-analysis-card">
        <div className="if-analysis-header">
          <div>
            <h2 className="if-h2">{formatTitle(analysisType)}</h2>
            <p className="if-muted">Upload dataset and run the selected analysis.</p>
          </div>
          <div className="if-muted">Analysis engine • fast</div>
        </div>

        <div className="if-analysis-grid">
          <div className="if-upload-col">
            <div className="if-panel">
              <h3 className="if-h3">Upload dataset</h3>
              <form onSubmit={onUpload}>
                <div className="if-upload-row">
                  <input ref={fileRef} type="file" accept=".csv,.xlsx" onChange={(e) => setFile(e.target.files[0])} />
                  <button type="submit" className="if-btn-accent" disabled={loading}>{loading ? 'Processing...' : 'Upload & Analyze'}</button>
                </div>
              </form>

              {columns.length > 0 && (
                <div className="if-detected">
                  <h4 className="if-h4">Detected Columns</h4>
                  <div className="if-tags">
                    {columns.map((c) => <span key={c} className="if-tag">{c}</span>)}
                  </div>
                </div>
              )}
            </div>

            <div className="if-results">
              <h3 className="if-h3">Analysis Results</h3>
              <div className="if-results-placeholder">Interactive results will appear here</div>
            </div>
          </div>

          <aside className="if-aside">
            <div className="if-panel">
              <div className="if-muted">Summary</div>
              <div className="if-strong">Ready to analyze</div>
              <p className="if-muted">Upload a dataset to see insights, anomaly detection, and suggested actions.</p>
            </div>

            <div className="if-panel">
              <div className="if-row-between">
                <div className="if-muted">Export</div>
                <div className="if-muted">PDF / CSV</div>
              </div>
              <div className="mt-3">
                <button className="if-btn">Export Report</button>
              </div>
            </div>

            <div className="if-panel">
              <div className="if-muted">Helpful Links</div>
              <ul className="if-links">
                <li>Sample datasets</li>
                <li>How analysis works</li>
                <li>Contact support</li>
              </ul>
            </div>
          </aside>
        </div>
      </div>
    </main>
  );
}

function formatTitle(slug) {
  if (!slug) return 'Analysis';
  return slug.split('-').map(s => s[0].toUpperCase() + s.slice(1)).join(' ');
}

export default function App() {
  return (
    <Router>
      <div className="if-app">
        <Header />
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/:analysisType" element={<AnalysisPage />} />
        </Routes>

        <footer className="if-footer">
          <div className="if-container">© {new Date().getFullYear()} InsightFlow — Built with care</div>
        </footer>
      </div>
    </Router>
  );
}
